      "job_description": "What are we looking for?\n\nPerceptive Analytics is looking for a Python Developer. This role is based out of Houston - Texas Area, US, and will have direct interaction with our client.\n\nThis is an excellent opportunity for the candidate with 2-6 years of experience in Python, who is willing to do all it takes to deliver the best possible results. The position offers above industry standard compensation package and excellent growth prospects. The title will be customized to the candidate\\u2019s experience and capability.\n\nRequired Skills\n• 2 to 6 years of development experience in Python.\n• Knowledge of Django framework and Python libraries\n• Significant experience in client interaction.\n• Should good knowledge of OOP design and patterns .\n• Good analytical and communication skills.\n• Ability to work independently, but as part of a team toward common goals.\n• Workflow and data analysis skills.\n• Working proficiency in developmental toolsets.\n• Understanding of software skills such as business analysis, development, maintenance and software improvement\n• Knowledge on E-Commerce and Amazon market place will be a plus.\n\nAdditional Skills/Knowledge\n• Degree in, or comparable background/experience in, computer application or engineering a plus.\n• Documents - US work permit - H1B Visa or other work permit is mandatory.\n\nCover Letter Guidelines\n\nPlease ensure that you write about the following statement in your cover letter, in a separate paragraph. This will help us to gauge your understanding about the position and your overall thought process for this role. Overlooking this will lead to rejection of your resume.\n\n\\u201CThe joy of coding Python should be in seeing short, concise and readable classes.\\u201D\n\nAbout Perceptive Analytics:\n\nWe are a marketing analytics and business intelligence company specialized in sales and marketing analytics. Our business insights, dashboards, and visualizations help our clients make sense of their data quickly and take actions that increase revenues and substantially lift profits.\n\nIn the last 10 years, we've solved complex business problems for Fortune 200 companies like Morgan Stanley, JP Morgan Chase, American Century Investments and Melissa & Doug.\n\nWe are a fast growing data analytics company with sales offices in New York, Houston- Texas, Miami, Dallas, San Bruno, and head office at Hyderabad. We have formed long-term relationships with our clients and that's why 70% of our business comes from serving them.\n\nHere's why our clients love us:\n• Strong domain knowledge helps us understand their business challenges quickly.\n• Talented team uses analytical skills to uncover uncommon insights.\n• Dashboards and tools are extremely simple to use and quick to grasp.\n\nWe handpick talent after sorting through hundreds of resumes and hire people with good attitude and skills. We train our people continuously so that they continue to remain the best at what they do. Our workplace is fun, challenging.\n\nWhat do we offer?\n• Perceptive is known for its employee-friendly approach.\n• Friendly environment \\u2013 the opportunity to do great work and set high standards. We are open and straightforward. We encourage transparency and accountability. We manage ourselves and trust others.\n• Good pay.\n\nKEY HIGHLIGHTS:\n• Chosen as the \\u2018Top 10 Emerging Data Analytics Company of 2018\\u2019.\n• Serving Fortune 200 clients for the past decade.\n• Talented team with a good blend of data nerds and domain experts.\n\nKEY SERVICES:\n• E-COMMERCE: Campaign optimization, Conversion optimization & Cross-sell/upsell.\n• PHARMA: Supply chain analytics, Salesforce effectiveness, & Demand forecasting.\n• RETAIL: Market basket analysis, Markdown optimization, & Promotion effectiveness.",
